def paint(data, shift=1, corner_step=10):
    dataNp =np.array(data).transpose()

    plt.plot(dataNp[1], dataNp[2])
    plt.show()


    height = 1020
    width = 1520
    frame = 10
    img = np.zeros((height, width, 3), np.uint8)
    cv2.rectangle(img, (0, 0), (width, height), (255, 255, 255), -1)

    dataNP = np.array(data)
    max_value = np.max(dataNP)
    min_value = np.min(dataNP)

    if abs(max_value) > abs(min_value):
        frame_size_img = abs(max_value) * 2
    else:
        frame_size_img = abs(min_value) * 2

    scale = 1 # (width - frame * 2)/frame_size_img

    poligon = []
    for row in range(0, len(data)):
        if row % corner_step == 0:
            el = data[row]
            X_next = width / 2 + el[shift]
            Y_next = height / 2 - el[shift+1]

            corner = [X_next, Y_next]
            poligon.append(corner)

    pts = np.array(poligon,  np.int64)
    pts = pts.reshape((-1, 1, 2))
    image = cv2.polylines(img, [pts], False, ( 0, 255, 0), 2)
